{"reasoning":"The ground-truth bug centers on an animation problem: the NPC is frozen in a T/A-pose, legs not animating, and the character slides/floats instead of walking. It is an animation/pose state issue, not primarily about geometry collisions or rendering.

The generated report speaks about the character model clipping through stairs and walls, lighting/shadow artifacts, and collision detection glitches that let the character pass through geometry. It does not mention T-pose/A-pose, missing leg animation, or sliding animation replacement. Its core problem is clipping/rendering, not animation state.

Because the key symptoms, affected systems, and underlying issue differ, the two reports do not describe the same bug.","match":false}

{"reasoning":"Ground-truth bug: when standing near a window the character is suddenly catapulted upward (physics launch) and, with a bent leg, ends up walking on the roof. The key symptoms are the unexpected vertical launch from a window area and unintended roof-walking; no mention is made of geometry errors or missing roof pieces.

Generated report: focuses on a different symptom – during a normal rooftop transition the roof mesh clips/misaligns, parts of it disappear, and the character appears to float or clip through geometry. It attributes the problem to visual/environment distortion rather than a physics launch from a window.

Because the generated report does not describe the sudden projection from the window, the bent-leg animation, or the involuntary launch; instead it highlights roof mesh issues, the two reports describe different bugs even though both occur on rooftops.", "match": false}

{"reasoning":"The ground-truth bug concerns a character (apparently dead/unconscious) hovering horizontally above a bar counter and clipping into the counter and a seated NPC. 

The generated report states that “the body lying on the counter appears to be floating or misaligned with the environment,” explicitly describing a floating body on a counter and a mis-alignment/clipping (physics issue). This is the same core symptom. Although the generated report adds extra speculation about shading/color glitches, that is supplemental; it does not contradict the main observation. The essential behavior—character model floating/intersecting with the counter—matches.
","match":true}

{"reasoning":"Ground truth bug: Door/vent refuses to open and, after the failed interaction, the player character begins bouncing up and down (a physics oscillation). Key symptoms: 1) door does not open, 2) unexpected vertical bouncing motion of the character.

Generated report: Describes door/elevator panel appearing partially open or mis-aligned, inconsistent animation/shadow rendering, character/shadow mis-positioned. Focuses on visual rendering and alignment, not on the door refusing to open or the player bouncing. No mention of continuous vertical movement; instead it talks about incorrect shadows and partial opening.

Because the core symptoms differ (bouncing vs rendering/shadow misalignment), the two reports point to different bugs.","match":false}

{"reasoning":"The ground-truth bug is about geometry clipping: (1) an enemy’s leg passing through a lamp post, (2) another enemy’s legs twisted in place, and (3) a foe being punched so that his whole body passes inside a truck. The common theme is collision/physics failure that lets characters intersect solid objects.

The generated report instead talks about (a) the character model stretching or elongating and (b) environment textures flickering or shifting, especially near the truck, during scene transitions. It does not mention characters intersecting or being embedded in world geometry, nor does it describe clipping through a lamp post or a truck. Conversely, the ground truth says nothing about texture flicker or general model stretching.

Because the key symptom (clipping into static objects) is missing from the generated report and new, unrelated symptoms (texture flicker) are introduced, the two descriptions do not refer to the same underlying bug.","match":false}

{"reasoning":"Ground truth bug is about enemy AI/pathfinding behavior: the enemy tries to move under a partially closed shutter, gets physically blocked, and its mesh clips through the door. It is a collision/navigation issue combined with mesh clipping.

Generated report talks about missing textures, broken geometry, misplaced environment elements, rendering glitches, corrupted character models, and potential crashes. It describes visual/texture problems, not an AI movement or collision issue. No mention of enemy movement under shutters or getting blocked while clipping through.

Therefore the two reports refer to different problems.","match":false}

{"reasoning":"The ground truth bug is about a black bird whose animation is stuck in a looping wing-flapping state while the bird remains fixed in place. Key elements: creature is a bird, animation is looping, it is not moving but repeatedly flapping.

The generated report speaks about a black cat model that is floating above the ground and clipping through the surface. Key elements: creature is a cat, issue is improper placement/rendering (floating, clipping), no mention of animation loops.

Different creature, different visual symptom (animation loop vs spatial clipping), different likely cause. Therefore they are not the same underlying bug.","match":false}

{"reasoning":"Ground truth describes a very specific animation/model swap bug: when a boy enters red robotic armor, he turns into a large naked headless person. It is a single, reproducible character-model transformation error.

The generated report, however, speaks broadly about various graphical issues: distorted or texture-less character models, flickering environment textures, weapon scope glitches, etc. It does not mention any transformation triggered by entering armor, nor the appearance of a large naked headless person. The focus is on general texture/rendering glitches across multiple elements rather than a specific character morphing bug.

Because the core symptom (sudden transformation into a specific wrong model after entering armor) is absent in the generated report, the two descriptions do not refer to the same underlying bug.","match":false}

{"reasoning":"Ground truth bug: attacking an NPC with a shovel eventually makes the NPC clip through the ground and fall out of the world. Key elements: interaction is between player and NPC, the NPC model falls through terrain after being attacked.

Generated bug: describes visual/rendering glitches on the PLAYER model and the shovel itself—duplication, distortion, misalignment of the player’s hands/arms/shovel, inconsistent shadows, potential clipping of player parts. No mention of NPC behavior after being hit, nor of models falling through the ground and disappearing.

Because the symptoms (NPC falling through ground vs. player model rendering glitches) and affected entities are different, these reports do not describe the same underlying bug.","match":false}

{"reasoning":"Ground truth focuses on a boat that suddenly accelerates on its own and then crashes/explodes, with the key symptom being the unexpected speed-up without any collision or input. 

The generated report instead talks about the boat breaking apart into floating debris, physics anomalies, and rendering issues. It does not mention any sudden self-acceleration or spontaneous crash/explosion; the emphasis is on structural breakage and visual/physics artifacts. These are different observable behaviors and likely different root causes.

Because the central symptom (sudden speed-up leading to explosion) is absent from the generated report, the two descriptions do not refer to the same bug.","match":false}
